import { routeGuard } from '../../../router/guard'

export default  [
    {
        path: '/producao',
        name: 'Produção',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/index.vue')
    },
    {
        path: '/partlist',
        name: 'PartList',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/partlist.vue')
    },
    {
        path: '/simulaproducao',
        name: 'SimulaProducao',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/simulaproducao.vue')
    },
    {
        path: '/controlelotes',
        name: 'ControleLotes',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/controlelotes.vue')
    },
    {
        path: '/conferenciaEstoques',
        name: 'ConferenciaEstoques',
        beforeEnter: routeGuard,
        component: () =>
            import ('../views/conferenciaestoques.vue')
    }
]
